(7, 1, '2025-03-19 22:10:24', '2025-03-19 20:10:24', '<!-- wp:group {\"align\":\"full\",\"style\":{\"spacing\":{\"padding\":{\"right\":\"var:preset|spacing|40\",\"left\":\"var:preset|spacing|40\",\"top\":\"var:preset|spacing|70\",\"bottom\":\"var:preset|spacing|70\"},\"margin\":{\"top\":\"0\",\"bottom\":\"0\"}},\"dimensions\":{\"minHeight\":\"0vh\"}},\"layout\":{\"type\":\"constrained\"}} -->\n<!-- wp:group {\"style\":{\"spacing\":{\"blockGap\":\"var:preset|spacing|40\"}},\"layout\":{\"type\":\"constrained\"}} -->\n<!-- wp:heading {\"textAlign\":\"center\",\"style\":{\"spacing\":{\"margin\":{\"right\":\"0\",\"left\":\"0\"},\"padding\":{\"right\":\"0\",\"left\":\"0\"}}},\"fontSize\":\"xx-large\"} -->\n<h2 style=\"margin-right: 0; margin-left: 0; padding-right: 0; padding-left: 0;\">Tell your story</h2>\n<!-- /wp:heading --><!-- wp:paragraph {\"align\":\"center\"} -->\n<p>Like flowers that bloom in unexpected places, every story unfolds with beauty and resilience, revealing hidden wonders.</p>\n<!-- /wp:paragraph --><!-- wp:buttons {\"layout\":{\"type\":\"flex\",\"justifyContent\":\"center\"}} -->\n<!-- wp:button -->\n<a>Learn more</a>\n<!-- /wp:button -->\n<!-- /wp:buttons -->\n<!-- /wp:group -->\n<!-- /wp:group --><!-- wp:group {\"align\":\"full\",\"className\":\"is-style-section-1\",\"style\":{\"spacing\":{\"padding\":{\"top\":\"var:preset|spacing|80\",\"bottom\":\"var:preset|spacing|80\"},\"margin\":{\"top\":\"0\",\"bottom\":\"0\"}}},\"layout\":{\"type\":\"constrained\"}} -->\n<!-- wp:columns {\"align\":\"wide\",\"style\":{\"spacing\":{\"blockGap\":{\"top\":\"var:preset|spacing|80\",\"left\":\"var:preset|spacing|80\"}}}} -->\n<!-- wp:column {\"width\":\"45%\",\"style\":{\"spacing\":{\"padding\":{\"right\":\"var:preset|spacing|50\"}}}} -->\n<!-- wp:image {\"sizeSlug\":\"full\"} -->\n<figure><img src=\"http://localhost/lqd/wp-content/themes/twentytwentyfive/assets/images/red-hibiscus-closeup.webp\" alt=\"Photography close up of a red flower.\" /></figure>\n<!-- /wp: