ct-ratio: 4/3; object-fit: cover;\" src=\"http://localhost/lqd/wp-content/themes/twentytwentyfive/assets/images/campanula-alliariifolia-flower.webp\" alt=\"Image for service\" /></figure>\n<!-- /wp:image --><!-- wp:heading {\"level\":3} -->\n<h3>Collect</h3>\n<!-- /wp:heading --><!-- wp:paragraph {\"fontSize\":\"medium\"} -->\n<p>Like flowers that bloom in unexpected places, every story unfolds with beauty and resilience</p>\n<!-- /wp:paragraph -->\n<!-- /wp:column --><!-- wp:column -->\n<!-- wp:image {\"aspectRatio\":\"4/3\",\"scale\":\"cover\",\"sizeSlug\":\"full\",\"style\":{\"spacing\":{\"margin\":{\"bottom\":\"24px\"}}}} -->\n<figure style=\"margin-bottom: 24px;\"><img style=\"aspect-ratio: 4/3; object-fit: cover;\" src=\"http://localhost/lqd/wp-content/themes/twentytwentyfive/assets/images/delphinium-flowers.webp\" alt=\"Image for service\" /></figure>\n<!-- /wp:image --><!-- wp:heading {\"level\":3} -->\n<h3>Assemble</h3>\n<!-- /wp:heading --><!-- wp:paragraph {\"fontSize\":\"medium\"} -->\n<p>Like flowers that bloom in unexpected places, every story unfolds with beauty and resilience</p>\n<!-- /wp:paragraph -->\n<!-- /wp:column --><!-- wp:column -->\n<!-- wp:image {\"aspectRatio\":\"4/3\",\"scale\":\"cover\",\"sizeSlug\":\"full\",\"style\":{\"spacing\":{\"margin\":{\"bottom\":\"24px\"}}}} -->\n<figure style=\"margin-bottom: 24px;\"><img style=\"aspect-ratio: 4/3; object-fit: cover;\" src=\"http://localhost/lqd/wp-content/themes/twentytwentyfive/assets/images/star-thristle-flower.webp\" alt=\"Image for service\" /></figure>\n<!-- /wp:image --><!-- wp:heading {\"level\":3} -->\n<h3>Deliver</h3>\n<!-- /wp:heading --><!-- wp:paragraph {\"fontSize\":\"medium\"} -->\n<p>Like flowers that bloom in unexpected places, every story unfolds with beauty and resilience</p>\n<!-- /wp:paragraph -->\n<!-- /wp:column -->\n<!-- /wp:columns -->\n<!-- /wp:group --><!-- wp:group {\"align\":\"full\",\"style\":{\"spacing\":{\"padding\":{\"top\":\"var:preset|spacing|60\",\"bottom\":